INSERT INTO plan_continuidad (`id_continuidad`, `codigo`, `denominacion`, `id_riesgo`, `id_departamento`, `id_empleado`, `id_estado`, `id_estrategia`, `tipo_plan`, `id_crisis`, `desc_crisis`, `id_recuperacion`, `desc_recuperacion`, `id_logistica`, `desc_logistica`, `id_rrpp`, `desc_rrpp`, `id_pruebas`, `desc_pruebas`, `consideraciones`, `pdf`, `fecha_creacion`, `fecha_modificacion`) VALUES (6, 'PCN-Proc001', 'Reacción contra caída de procesos de TI', 23, 1, 1, 2, 2, 'reactivo', 1, 'El equipo de crisis debe evaluar en 10 minutos cuanto tiempo ha estado caido el proceso e indicar acciones a los demás equipos.', 4, 'Recuperación debe ir armando estaciones paralelas y estableciendo los monitores y conexiones necesarias.', 6, 'Recopilar cualquier infraestructura necesaria para el equipo de recuperación', 7, 'No informar de la caída hasta que el comité de crisis lo decida', 10, 'Una vez recuperado. Iniciar protocolos de pruebas', '', '/var/www/html/tesis/assets/back/continuidad_uploads/reaccion_contra_caida_de_procesos_de_ti.pdf', '2014-10-10 19:50:34', '2014-10-13 17:57:54');
INSERT INTO plan_continuidad (`id_continuidad`, `codigo`, `denominacion`, `id_riesgo`, `id_departamento`, `id_empleado`, `id_estado`, `id_estrategia`, `tipo_plan`, `id_crisis`, `desc_crisis`, `id_recuperacion`, `desc_recuperacion`, `id_logistica`, `desc_logistica`, `id_rrpp`, `desc_rrpp`, `id_pruebas`, `desc_pruebas`, `consideraciones`, `pdf`, `fecha_creacion`, `fecha_modificacion`) VALUES (7, 'PCN001', 'Falla de proceso de impresión remota', 24, 2, 3, 2, 5, 'reactivo', 1, 'If needle is a string, the comparison is done in a case-sensitive manner.', 3, 'Searches haystack for needle using loose comparison unless strict is set.', 5, 'If the third parameter strict is set to TRUE then the in_array()', 7, 'Function will also check the types of the needle in the haystack.', 9, 'Returns TRUE if needle is found in the array, FALSE otherwise.', '', '/var/www/html/tesis/assets/back/continuidad_uploads/falla_de_proceso_de_impresion_remota.pdf', '2014-10-12 17:22:50', '2014-10-13 21:26:44');
INSERT INTO plan_continuidad (`id_continuidad`, `codigo`, `denominacion`, `id_riesgo`, `id_departamento`, `id_empleado`, `id_estado`, `id_estrategia`, `tipo_plan`, `id_crisis`, `desc_crisis`, `id_recuperacion`, `desc_recuperacion`, `id_logistica`, `desc_logistica`, `id_rrpp`, `desc_rrpp`, `id_pruebas`, `desc_pruebas`, `consideraciones`, `pdf`, `fecha_creacion`, `fecha_modificacion`) VALUES (8, 'ICS-001', 'Levantamiento de Servidor en la DIUC', 25, 1, 1, 2, 6, 'reactivo', 12, 'Debe determinar el nivel de inundación en el cuarto del servidor lo más pronto posible. Decidir la activación del PCN.', 14, 'Luego de la orden del Comité de Crisis, debe trasladarse con urgencia a las instalaciones de la DIUC en el Rectorado UC ubicado al lado de la Torre Banaven en la Av. Bolivar Sur de Valencia.\nIniciar los protocolos de recuperación con el equipo que ya dispone la DIUC para este caso.', 5, 'Debe llamar a las oficinas de la DIUC de manera inmediata para hacerles saber de la contingencia de manera de que vayan preparando los equipos.', 15, 'Debe esperar la orden del comité de crisis para hacer llegar la información a los clientes', 9, 'Trasladarse a la DIUC y realizar las pruebas pertinentes para la puesta en marcha en el sitio recíproco.', '', '/var/www/html/tesis/assets/back/continuidad_uploads/levantamiento_de_servidor_en_la_diuc.pdf', '2014-10-15 04:33:15', '2014-10-14 23:05:45');
